import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';
import slider1 from "../Images/banner-1.jpg"
import slider2 from "../Images/banner-2.jpg"

function CarouselCustomNavigation() {
  return ( 
    <div>
            <Carousel>
                <div>
                    <img src={slider1}  alt="banner1"/>
                    <p className="absolute 2xl:left-1/4 top-1/3 ms-10 text-center text-3xl bg-transparent text-black sm:text-lg sm:left-28">Get All <br/> The Good Stuff</p>
                </div>
                <div>
                    <img src={slider2} alt="banner2"/>
                    <p className="absolute left-1/4 top-1/3 ms-10 text-center text-3xl bg-transparent text-white">The Most Beautiful <br/>Products In Our Shop</p>
                </div>
            </Carousel>
    </div>
   );
}

export default CarouselCustomNavigation;
